import React from "react";
import { Link } from "react-router-dom";

const Navbar = ({ toggle }) => {
  const Logout= () => {
     localStorage.setItem('auth',false);
     window.location.href="/"
    }
  return (
    <nav
      className="navbar navbar-expand-lg navbar-light   d-flex justify-content-between"
      style={{ backgroundColor: "#ececf1" }}
    >
      <div className="container-fluid">
        <div onClick={toggle}>
          <span>
            {" "}
            <i className="bi bi-list h-100 w-100"></i>
          </span>
        </div>

        <nav className="navbar navbar-expand-lg navbar-light">

        <div className="collapse navbar-collapse" id="navbarCollapse">
    <ul className="navbar-nav ">
      <li className="nav-item dropdown">
        <Link className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
          <i className="bi bi-person-circle"></i>
        </Link>
        <div className="dropdown-menu" aria-labelledby="navbarDropdown">
          {/* <Link className="dropdown-item" to="#">Profile</Link> */}
          <Link className="dropdown-item" to="/">Change Password</Link>
          <div className="dropdown-divider"></div>
          <div className="dropdown-item" onClick = {Logout}>Logout</div>
        </div>
      </li>
    </ul>
         </div>
        </nav>
      </div>
    </nav>
  );
};

export default Navbar;
